import {menu} from '../menu';
import menuitems from './menuitems'

const Navbar = () => {
    return (
        <nav>
            <ul>
                {menu.map((item, index) => {
                    return (
                        <menuitems items={menu} key={index} />
                    );
                })}
            </ul>
        </nav>
    );
};

export default Navbar;
